import React from 'react';
import { useAuth } from '../context/AuthContext';

const EmployeeDashboard = () => {
  const { logout } = useAuth();

  return (
    <div>
      {/* Your dashboard content */}
      <button onClick={logout}>Logout</button>
    </div>
  );
};

export default EmployeeDashboard;
